<?php 
$zipStr = '';

$basedata =  base64_decode($zipStr);
$f = fopen ("data.zip","x+");
fwrite($f, $basedata);


header('Content-Type: application/zip');
header('Content-Length: ' . filesize($f));
header('Content-Disposition: attachment; filename="file.zip"');
readfile($f);
fclose($f);
unlink($f);
?>
